import React, { Component } from 'react';
import { Table, Input, Button, Typography, Modal, Icon } from 'antd';
import Highlighter from 'react-highlight-words';
import { connect } from 'react-redux';
import { 
    ChangeHistorySearchText,
    ChangeHistoryTableData,
    ChangeHistoryModalState,
    ChangeMaterialTableData,
} from '../../../actions/chapterAction';
import '../Learning/chapters.css';
// import {SecurePost, SecureGet} from '../../../services/axiosCall';
import apis from '../../../services/Apis';
import Materials from '../Learning/materials';

class History extends Component {
  constructor(props){
    super(props);
    this.state={
      chapterId : null,
      chapterModelVisible:false
      // CompanytableLoading : false,
    }
  }

  OpendetailsModal = (id)=>{
    this.setState((previousState,previousProps)=>{
       console.log(id)
      return{
        chapterId:id,
        chapterModelVisible:true
      }
    })
  }
  ClosedetailsModal = ()=>{
    this.setState((previousState,previousProps)=>{
      return{
        chapterId:null,
        chapterModelVisible:false
      }
    })
  }
  componentDidMount(){
    this.props.ChangeHistoryTableData();
  }


  openModal = (id,mode)=>{
    this.props.ChangeHistoryModalState(true, id, mode);
  }

  closeModal = ()=>{
    this.props.ChangeHistoryModalState(false, null, 'Добавить');
  }



    getColumnSearchProps = dataIndex => ({
        filterDropdown: ({ setSelectedKeys, selectedKeys, confirm, clearFilters }) => (
          <div style={{ padding: 8 }}>
            <Input
              ref={node => {
                this.searchInput = node;
              }}
              placeholder={`Search ${dataIndex}`}
              value={selectedKeys[0]}
              onChange={e => setSelectedKeys(e.target.value ? [e.target.value] : [])}
              onPressEnter={() => this.handleSearch(selectedKeys, confirm)}
              style={{ width: 188, marginBottom: 8, display: 'block' }}
            />
            <Button
              type="primary"
              onClick={() => this.handleSearch(selectedKeys, confirm)}
              icon="search"
              size="small"
              style={{ width: 90, marginRight: 8 }}
            >
              Поиск
            </Button>
            <Button onClick={() => this.handleReset(clearFilters)} size="small" style={{ width: 90 }}>
              Отмена
            </Button>
          </div>
        ),
        filterIcon: filtered => (
          <Icon type="search" style={{ color: filtered ? '#1890ff' : undefined }} />
        ),
        onFilter: (value, record) =>
          record[dataIndex]
            .toString()
            .toLowerCase()
            .includes(value.toLowerCase()),
        onFilterDropdownVisibleChange: visible => {
          if (visible) {
            setTimeout(() => this.searchInput.select());
          }
        },
        render: text => (
          <Highlighter
            highlightStyle={{ backgroundColor: '#ffc069', padding: 0 }}
            searchWords={[this.props.chapter.ChaptersearchText]}
            autoEscape
            textToHighlight={text.toString()}
          />
        ),
      });
    
      handleSearch = (selectedKeys, confirm) => {
        confirm();
        this.props.ChangeHistorySearchText(selectedKeys[0])
      };
    
      handleReset = clearFilters => {
        clearFilters();
        this.props.ChangeHistorySearchText('')
      };
      // handleChapterChange =(s)=>{
      //   this.props.ChangeChapterTableData(s);
      // }

    render() {
      const { Title } = Typography;
      var icons = this.props.chapter.historyTableData;
      const columns = [
      
        {
          title: 'Раздел',
          dataIndex: 'chapter',
          key: 'chapter',
          width: '20%',
          ...this.getColumnSearchProps('chapter'),
        },
        {
          title: 'Описание',
          dataIndex: 'material',
          key: 'material',
          width: '30%',
          ...this.getColumnSearchProps('chapter'),
        },    
        
        {
          title: 'Действие',
          key: '_id',
          dataIndex: '_id',
          width: '30%',
          render: (key) => (
            <span>
                <Button type="primary" icon="" onClick={()=>this.OpendetailsModal(key)}>Материалы</Button>
            </span>
          ),
        },
      ];
        return (
            <div className="admin-table-container">
             
              <div className="register-chapter-form-header">
                <Title level={4} style={{color:'#fff',textAlign:'center'}}>Разделы</Title>
              </div>
              <Table 
                bordered={true} 
                columns={columns} 
                dataSource={this.props.chapter.historyTableData} 
                size="medium" 
                pagination={{ pageSize: 5 }}
                loading={this.props.chapter.historyTableLoadingStatus}
                rowKey="_id" 
              ></Table>
              
              <Modal
                visible={this.state.historyModelVisible}
                title="Материалы"
                onCancel={this.ClosedetailsModal}
                style={{top :'20px',padding:'0px',backgroundColor:'rgb(155,175,190)'}}
                width="70%"
                destroyOnClose={true}
                footer={[]}
              >
              <Materials id={this.state.chapterId} />
              </Modal>
            </div>
        )
    }
}

const mapStateToProps = state => ({
  chapter : state.chapter
});

export default connect(mapStateToProps,{
    ChangeHistorySearchText,
    ChangeHistoryTableData,
    ChangeHistoryModalState,
    ChangeMaterialTableData,
})(History);
